//React
import React from "react";
//Bootstrap Components

//Components
import Nav from './nav';
import CopyBlock from "./copyBlock";
import CardWidget from "./cardWidget";
import Footer from './footer';

function App() {
  return (
    <div className="app">
      <Nav />
      <CopyBlock />
      <Footer />
    </div>
  );
}

export default App;
